syntax "proto3";

package azurerm;

message AzurermApplicationInsightsAnalyticsItem {
  application_insights_id = 1;
  content = 2;
  function_alias = 3;
  id = 4;
  name = 5;
  scope = 6;
  time_created = 7;
  time_modified = 8;
  type = 9;
  version = 10;
  message Timeouts {
    create = 1;
    delete = 2;
    read = 3;
    update = 4;
  }
  timeouts = 11;
}